import {Component} from 'react'


class Index extends Component {

    constructor(props) {
        super(props);

    }



    render() {

        return (
            <div className="d-flex align-items-center" style={{width:'100%', backgroundColor: "white", height: 70}}>

                <img src="/static/logo.png" style={{objectFit:'contain', height:25, cursor:'pointer'}}/>

                <div>
                    Dashboard, Schedule, Analytics
                </div>

            </div>
        );

    }
} 

export default Index;
